Event Player.CurrentKills = Event Player.CurrentKills + 1.0;
If(Event Player.CurrentKills >= Event Player.MaxKills);
Kill(Event Player, Null);
Else;

End;

Event Player.DamageDealt = Random Real(50.0, 500.0);
Event Player.DamageReceived = Random Real(50.0, 500.0);
Event Player.HealingDealt = Random Real(50.0, 500.0);
Event Player.HealingReceived = Random Real(50.0, 500.0);
Event Player.KnockbackDealt = Random Real(50.0, 500.0);
Event Player.KnockbackReceived = Random Real(50.0, 500.0);
Event Player.ProjectiveGravity = Random Real(50.0, 500.0);
Event Player.ProjectiveSpeed = Random Real(50.0, 500.0);
Event Player.MaxHealth = Random Real(50.0, 500.0);

Set Damage Dealt(Event Player, Event Player.DamageDealt);
Set Damage Received(Event Player, Event Player.DamageReceived);
Set Healing Dealt(Event Player, Event Player.HealingDealt);
Set Healing Received(Event Player, Event Player.HealingReceived);
Set Knockback Dealt(Event Player, Event Player.KnockbackDealt);
Set Knockback Received(Event Player, Event Player.KnockbackReceived);
Set Projectile Gravity(Event Player, Event Player.ProjectiveGravity);
Set Projectile Speed(Event Player, Event Player.ProjectiveSpeed);
Set Max Health(Event Player, Event Player.MaxHealth);

Create HUD Text(Event Player,Custom String("Player Stats"), Null, Null, Left, 0.0, Custom Color(3.0, 96.0, 134.0, 3.0), Color(White), Color(White), Visible To and String, Default Visibility);
Create HUD Text(Event Player,Null, Custom String("Damage Dealt {0}%", Event Player.DamageDealt), Null, Left, 0.0, Color(White), Color(White), Color(White), Visible To and String, Default Visibility);
Create HUD Text(Event Player,Null, Custom String("Damage Received {0}%", Event Player.DamageReceived), Null, Left, 0.0, Color(White), Color(White), Color(White), Visible To and String, Default Visibility);
Create HUD Text(Event Player,Null, Custom String("Healing Dealt {0}%", Event Player.HealingDealt), Null, Left, 0.0, Color(White), Color(White), Color(White), Visible To and String, Default Visibility);
Create HUD Text(Event Player,Null, Custom String("Healing Received {0}%", Event Player.HealingReceived), Null, Left, 0.0, Color(White), Color(White), Color(White), Visible To and String, Default Visibility);
Create HUD Text(Event Player,Null, Custom String("Knockback Dealt {0}%", Event Player.KnockbackDealt), Null, Left, 0.0, Color(White), Color(White), Color(White), Visible To and String, Default Visibility);
Create HUD Text(Event Player,Null, Custom String("Knockback Received {0}", Event Player.KnockbackReceived), Null, Left, 0.0, Color(White), Color(White), Color(White), Visible To and String, Default Visibility);
Create HUD Text(Event Player,Null, Custom String("Projectile Gravity {0}", Event Player.ProjectiveGravity), Null, Left, 0.0, Color(White), Color(White), Color(White), Visible To and String, Default Visibility);
Create HUD Text(Event Player,Null, Custom String("Projectile Speed {0}", Event Player.ProjectiveSpeed), Null, Left, 0.0, Color(White), Color(White), Color(White), Visible To and String, Default Visibility);

Event Player.MaxKills = 10.0;
Event Player.CurrentKills = 0.0;
Create HUD Text(Event Player,Custom String("Kills: {0}/{1}", Event Player.CurrentKills, Event Player.MaxKills), Null, Null, Right, 0.0, Color(White), Color(White), Color(White), Visible To and String, Default Visibility);
Call Subroutine(SetPlayerStats);
